import './Skills.css';

const skills=[
    {
        title: "Programs:",
        description: "HTML, CSS, Javascript, SCSS"
    },
    {
        title: "Libraries:",
        description: "Bootstrap 5"
    },
    {
        title: "Khác:",
        description: "Thiết kế UX/UI"
    },
    {
        title: "Ngôn ngữ:",
        description: "Có thể đọc các tài liệu, văn bản Tiếng Anh        "
    }

]

function Skills(){
    return(
        <div className='skills' id='skills'>
            <h1>Kỹ Năng</h1>
            <div className='skill-content'>
                <img src='../image/ava.jpeg'></img>
                <div className='text-content'>
                    <div className='text-item profile'>
                        <span className='text-title'>Programs: </span>
                        <span className='text-title'>HTML, CSS, Javascript, SCSS</span>
                    </div>
                </div>
            </div>
        </div>
    )

}
export default Skills;
